              font-style: normal;
              font-weight: normal;  
              line-height: 32px; 
              margin: 0; 
              padding: 0 0 0 .5em; 
              position: relative;
            }
            
            .rna-header a {
              text-decoration: none;
            	color: #BFBFBF;
            }
            
            .rna-header a:hover {
            	color: #ffffff;
            }

            /* google search */

            #goog-fixurl ul {
                list-style: none;
                padding: 0;
                margin: 0;
            }

                margin: 0;

            #goog-wm-qt,
            #goog-wm-sb {
                border: 1px solid #bbb;

                -moz-appearance: none;
                appearance: none;

                *display: inline;
                *zoom: 1;
            }

            #goog-wm-sb:hover,
            #goog-wm-sb:focus {
                border-color: #aaa;
                box-shadow: 0 1px 1px rgba(0, 0, 0, 0.1);
                background-color: #f8f8f8;

                border-color: #4b7dc8;
                outline: 0;
                color: #222;

                padding: 0;
                border: 0;
